import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Profile from './components/Profile/Profile';
import Dialogs from './components/Dialogs/Dialogs';
import News from './components/News/News';
import Friends from './components/Friends/Friends';
import Photo from './components/Photo/Photo';
import Settings from './components/Settings/Settings';
import {BrowserRouter, Route} from "react-router-dom";


const App = (props) => {

  return (
    <BrowserRouter>
    <div className='app-wrapper'>
      <Header />
      <Navbar />
      <div class='app-wrapper-content'>
        <Route path='/Dialogs' render={ () => <Dialogs dialogs={props.state.messagesPage.dialogs} messages={props.state.messagesPage.messages} /> } />
        <Route path='/Profile' render={ () => <Profile s={props.state.profilePage.posts} /> } />
        <Route path='/News' render={ () => <News /> } />
        <Route path='/Friends' render={ () => <Friends /> } /> 
        <Route path='/Photo' render={ () => <Photo /> } />
        <Route path='/Settings' render={ () => <Settings /> } /> 
      </div >
      </div>
    </BrowserRouter>
  )
}

export default App;
